namespace MGroup.XFEM.Tests.Fracture.ThreeDimensional
{
    public static class Hexa8XElementTest
    {
        private const double E = 2E6, v = 0.3;
        private const double L = 1.0;
        private const double xCrack = 1.5; // The crack is normal to X axis and intersects element with ID=1 into 2 equal parts
        private const int subdomainID = 0;

        [Fact]
        public static void TestElementStiffnesses()
        {
            XModel<IXCrackElement> model = CreateModel();
            CreateCrack(model);
            model.Initialize();

            double tol = 1E-4;
            foreach (IXFiniteElement element in model.Elements)
            {
                IMatrix computedK = element.StiffnessMatrix(element);
                #region debug
                //string path = @"C:\Users\Serafeim\Desktop\temp\" + $"K{element.ID}.txt";
                //var writer = new ISAAR.MSolve.LinearAlgebra.Output.FullMatrixWriter();
                //writer.ArrayFormat = ISAAR.MSolve.LinearAlgebra.Output.Formatting.Array2DFormat.CSharpArray;
                //writer.WriteToFile(computedK, path);
                #endregion
                Matrix expectedK = GetExpectedStiffness(element.ID);
                Assert.True(expectedK.Equals(computedK, tol));
            }
        }

        private static XModel<IXCrackElement> CreateModel()
        {
            var model = new XModel<IXCrackElement>(3);
            model.Subdomains[subdomainID] = new XSubdomain(subdomainID);

            // Nodes
            model.XNodes.Add(new XNode(0, 0,  0, 0));
            model.XNodes.Add(new XNode(1, L,  0, 0));
            model.XNodes.Add(new XNode(2, 2L, 0, 0));
            model.XNodes.Add(new XNode(3, 3L, 0, 0));
            model.XNodes.Add(new XNode(4, 4L, 0, 0));
            model.XNodes.Add(new XNode(5, 0,  L, 0));
            model.XNodes.Add(new XNode(6, L,  L, 0));
            model.XNodes.Add(new XNode(7, 2L, L, 0));
            model.XNodes.Add(new XNode(8, 3L, L, 0));
            model.XNodes.Add(new XNode(9, 4L, L, 0));

            model.XNodes.Add(new XNode(10, 0,  0, L));
            model.XNodes.Add(new XNode(11, L,  0, L));
            model.XNodes.Add(new XNode(12, 2L, 0, L));
            model.XNodes.Add(new XNode(13, 3L, 0, L));
            model.XNodes.Add(new XNode(14, 4L, 0, L));
            model.XNodes.Add(new XNode(15, 0,  L, L));
            model.XNodes.Add(new XNode(16, L,  L, L));
            model.XNodes.Add(new XNode(17, 2L, L, L));
            model.XNodes.Add(new XNode(18, 3L, L, L));
            model.XNodes.Add(new XNode(19, 4L, L, L));

            // Elements
            var material = new HomogeneousFractureMaterialField3D(E, v);
            var enrichedIntegration = new IntegrationWithNonconformingSubhexahedra3D(2, GaussLegendre3D.GetQuadratureWithOrder(2, 2, 2));
            var bulkIntegration = new CrackElementIntegrationStrategy(
                enrichedIntegration, enrichedIntegration, enrichedIntegration);
            var factory = new XCrackElementFactory3D(material, bulkIntegration);
            
            var elements = new IXCrackElement[4];
            elements[0] = factory.CreateElement(0, CellType.Hexa8, new XNode[]
            {
                model.XNodes[0], model.XNodes[1], model.XNodes[6], model.XNodes[5],
                model.XNodes[10], model.XNodes[11], model.XNodes[16], model.XNodes[15]
            });
            elements[1] = factory.CreateElement(1, CellType.Hexa8, new XNode[]
            {
                model.XNodes[1], model.XNodes[2], model.XNodes[7], model.XNodes[6],
                model.XNodes[11], model.XNodes[12], model.XNodes[17], model.XNodes[16]
            });
            elements[2] = factory.CreateElement(2, CellType.Hexa8, new XNode[]
            {
                model.XNodes[2], model.XNodes[3], model.XNodes[8], model.XNodes[7],
                model.XNodes[12], model.XNodes[13], model.XNodes[18], model.XNodes[17]
            });
            elements[3] = factory.CreateElement(3, CellType.Hexa8, new XNode[]
            {
                model.XNodes[3], model.XNodes[4], model.XNodes[9], model.XNodes[8],
                model.XNodes[13], model.XNodes[14], model.XNodes[19], model.XNodes[18]
            });

            foreach (IXCrackElement element in elements)
            {
                model.Elements.Add(element);
                model.Subdomains[subdomainID].Elements.Add(element);
            }

            return model;
        }

        private static void CreateCrack(XModel<IXCrackElement> model)
        {
            var geometryModel = new CrackGeometryModel(model);
            model.GeometryModel = geometryModel;
            var crack = new MockCrack(model);
            geometryModel.Enricher = new MockNodeEnricher(model, crack);
            geometryModel.Cracks[crack.ID] = crack;
        }

